from functools import lru_cache

@lru_cache(maxsize = 10000)
def canProd(i,m):

    if m == 0:
        return True
    if i >= n:
        return False

    res = canProd(i+1,m) or canProd(i+1,m-a[i])
    return res


n = int(input())
a = [int(x) for x in input().split()]
